import React from 'react';
import './App.css';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import HomeIcon from '@material-ui/icons/Home';
import FavoriteIcon from '@material-ui/icons/Favorite';
import VideocamIcon from '@material-ui/icons/Videocam';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';

function App() {

  function TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`tabpanel-${index}`}
        {...other}
      >
        {value === index && (
          <Box p={3}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  }

  const [value, setValue] = React.useState(0);
  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className="App">
      <header className="page-header">
        <img src={"https://static-cdn.jtvnw.net/jtv_user_pictures/690c1f7a-dda3-424c-9520-9b12f4ce58b6-profile_image-70x70.png"} className="profile-icon" alt="Whoops..." />
        <p>
          KrunkyXO
        </p>
      </header>
      <AppBar position="static" className="tab-bar-wrapper">
        <Tabs value={value} onChange={handleChange}  className="tab-bar">
          <Tab icon={<HomeIcon />} label="Home" id="tab-home" />
          <Tab icon={<FavoriteIcon />} label="About Me" id="tab-about" />
          <Tab icon={<VideocamIcon />} label="Stream Schedule" id="tab-schedule" />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}>
        <div className="page-body">
          <div className="body-section">
          <a
            className="link"
            href="https://www.twitch.tv/krunkyxo"
            target="_blank"
            rel="noopener noreferrer"
          >
            Visit My Stream
          </a>
          </div>
          <div className="body-section">
            <img src={"https://panels-images.twitch.tv/panel-18534071-image-433ff042-3420-4edd-a88f-ac3de02bddeb"} className="body-image" alt="Whoops..." />
            <List component="nav" className="common-list">
              <ListItem button>
                <ListItemIcon>

                </ListItemIcon>
                <ListItemText primary="Twitter" />
              </ListItem>
            </List>
          </div>
        </div>
      </TabPanel>
      <TabPanel value={value} index={1}>
        Item TwTso
      </TabPanel>
      <TabPanel value={value} index={2}>
        Item Three
      </TabPanel>


    </div>
  );
}

export default App;
